using Newtonsoft.Json;
using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Net;
using System.Text;
using System.Threading.Tasks;
using System.Web;

namespace Common
{
    public static class VietQR
    {
        public static string GenerateQR(string money, string noidung)
        {
            var httpWebRequest = (HttpWebRequest)WebRequest.Create("https://api.vietqr.io/v2/generate");
            httpWebRequest.ContentType = "application/json";
            httpWebRequest.Method = "POST";
            httpWebRequest.Timeout = 12000;
            httpWebRequest.ContentType = "application/json";
            httpWebRequest.Headers.Add("x-client-id", "2e72b9a6-62b6-4e85-a52e-d385fc194a66");
            httpWebRequest.Headers.Add("x-api-key", "55095623-091b-4542-a01e-b932c7fa0be3");

            using (var streamWriter = new StreamWriter(httpWebRequest.GetRequestStream()))
            {
                BodyVietQR vietQR = new BodyVietQR();
                vietQR.accountNo = "0981609203";
                vietQR.accountName = "NGUYEN BA KIEN";
                vietQR.acqId = "970432";
                vietQR.addInfo = noidung;
                vietQR.amount = money;
                vietQR.colorDark = "#000";
                vietQR.logo = "data:image/png;base64,";
                vietQR.logoBank = "https://api.vietqr.io/img/VPB.ca2e7350.png";
                vietQR.template = "qr_only";
                vietQR.theme = "qr_only";
                string json = JsonConvert.SerializeObject(vietQR);

                streamWriter.Write(json);
            }

            var httpResponse = (HttpWebResponse)httpWebRequest.GetResponse();
            using (var streamReader = new StreamReader(httpResponse.GetResponseStream()))
            {
                var result = streamReader.ReadToEnd();

                Root myDeserializedClass = JsonConvert.DeserializeObject<Root>(result);
                var MyQRWithLogo = myDeserializedClass.data.qrDataURL;
                return MyQRWithLogo;
            }
        }
    }
}

public class BodyVietQR
{
    public string accountName { get; set; }
    public string accountNo { get; set; }
    public string acqId { get; set; }
    public string addInfo { get; set; }
    public string amount { get; set; }
    public string colorDark { get; set; }
    public string logo { get; set; }
    public string template { get; set; }
    public string theme { get; set; }
    public string logoBank { get; set; }
}
